  return (
    <div className="App" style={{ padding: "25px" }}>
      <div>
        <NavBar onSearch={(characterID) => window.alert(characterID)} />
      </div>
      <hr />
      <div>
        <Cards characters={characters} />
      </div>
      <hr />
    </div>
  );
}

export default App;
